//the data being used here is from d3_geojson/ukgeojson/rewoundukgeojson2.json

//hardcoding the hex code for one of the colors in the theme
const specific_blue = '#0075ff';

//Get_population_data accepts a number that represents the number of towns to obtain data for
// the data is then obtained from a webserver in a synchronous fashion so that it can be used in the global scope
function Get_population_data(number_of_towns) {
	//using jquery and ajax to get the population data into the global scope
	let population_data;
	$.ajax({
		async:false,
		url:"http://34.78.46.186/Circles/Towns/" + number_of_towns,
		success: function(data){
			population_data = data;
		}
	});

	//the data is in a string, so it needs to be converted to an object before using it
	population_data = JSON.parse(population_data);

	//sorting the data in descending population so circles with smaller radii 
	// (which will scale on population) are drawn later so as to avoid overlapping issues
	// due to svg not working with z-index
	// does not address the case where n smaller objects completely cover a single larger object
	// which is more likely to happen when the number of towns is higher
	population_data.sort(function(a,b) {
		return b.Population-a.Population;
	});

	return population_data;
}

//initializing the population data in the global scope
let population_data = Get_population_data(50);

//Update_population_data takes in a number and updates the population data
function Update_population_data(number_of_towns) {
	population_data = Get_population_data(number_of_towns);
}

function Draw() {
	//a rectangular projection transforms long/latitude into cartesian coordinates
	// part of this following code block
	// was adapted from d3.indepth.com/geographic/
	let projection = d3.geoEquirectangular().fitSize([width,height],geoJson);
	let geoGenerator = d3.geoPath().projection(projection);
	d3.select('#geomap g.map')
	.style('fill','#ffffff')
	.style('stroke','#bbbbbb')
	.selectAll('path')
	.data(geoJson.features)
	.join('path')
	.attr('d',geoGenerator);
	
	//placing an svg within the geomap div, for the tooltip, and defining its style
	// by default, the tooltip is hidden
	var tooltip = d3.select('#geomap')
	.append('svg')
	.attr('width','250px')
	.attr('height','76px')
	.style('visibility','hidden')
	.style('background','white')
	.style('position','absolute')
	.style('padding','5px')
	.style('font','12px sans-serif')
	.style('border','4px')
	.style('border-style','solid')
	.style('border-color','black');

	//entering the population data to determine the number of circles
	// and setting the stroke and color of the circles
	var circles = d3.select('svg')
	.selectAll('circle')
	.data(population_data).enter()
	.append('circle')
	.attr('fill','transparent')
	.attr('stroke',specific_blue)
	.attr('stroke-opacity',0.5)
	.attr('stroke-width',2)
	//when a circle is moused over, the tooltip fills with data regarding the point
	.on('mouseover', function(event,d) {
		d3.select(this)
		.attr('fill','transparent')
		//on hover, stroke width of the circle expands and the radius resizes 
		// to show the position of the town more precisely
		// the "precision circle" is 2px in radius
		//if the population is low enough such that the stroke width would be less than 0,
		// then just use the default stroke width and radius
		.attr('stroke-width',function(d) {
				if (Math.sqrt(d.Population)/30+1-2 <= 0) {
					return 1;
				} else {
					return Math.sqrt(d.Population)/30+1-2;
				}
			})
		.attr('r',function(d) {
				if (Math.sqrt(d.Population)/30+1-2 <= 0) {
					return Math.sqrt(d.Population)/30;
				} else {
					return (Math.sqrt(d.Population)/30+1+2)/2;
				}
			})
		tooltip.append('text').attr('x','4px').attr('y','16px').text('Town: '+ d.Town);
		tooltip.append('text').attr('x','4px').attr('y','30px').text('County: ' + d.County);
		tooltip.append('text').attr('x','4px').attr('y','44px').text('Population: ' + d.Population);
		tooltip.append('text').attr('x','4px').attr('y','58px').text('Longitude: ' + d.lng);
		tooltip.append('text').attr('x','4px').attr('y','72px').text('Latitude: ' + d.lat);
	})
	//while the mouse hovers and moves over the circle, the tooltip becomes visible and follows it
	.on('mousemove', function(event,d) {
		tooltip.style('visibility','visible')
		.style('top', (event.pageY-50)+'px')
		.style('left', (event.pageX+25)+'px')
	})
	//when the mouse leaves the circle, the tooltip becomes hidden again and the text is erased from it
	.on('mouseout', function(event,d) {
		d3.select(this).attr('fill','transparent')
		.attr('r', function(d) {return Math.sqrt(d.Population)/30})
		.attr('stroke-width',2)
		tooltip.style('visibility','hidden');
		d3.select('#geomap').selectAll('text').remove();
	});

	//when data is loaded, the circles undergo an animation
	// the radius is set to be the square root of the population so that 
	// area is proportional to population
	circles.transition()
	.duration(500)
	.ease(d3.easeCircleInOut)
	.attr('cx',function(d) {return projection([d.lng,d.lat])[0]})
	.attr('cy',function(d) {return projection([d.lng,d.lat])[1]})
	.attr('r', function(d) {return Math.sqrt(d.Population)/30});
	
	//below the map, add a bit of text that states the current number of towns
	d3.select('#interactive')
	.append('text')
	.text('Number of towns: ' + document.getElementById("slider").value);
	
	//below the map, there is a button that 
	// will reset the data of the circles when clicked
	d3.select('button').on('click',function() {
		Reset_map(document.getElementById('slider').value);
	});	
	
	//below the map, there is a slider. 
	// when the user lets go of the slider knob, the circles update
	// to their new quantity
	document.getElementById('slider').onchange = function() {
		Reset_map(document.getElementById('slider').value);
	};
	
	//while the slider is being changed, the aforementioned bit of text updates to reflect
	// how many circles there will be on the map when the user lets go of the slider knob
	document.getElementById('slider').oninput = function() {
		d3.select('#interactive').select('text').remove();
		d3.select('#interactive')
		.append('text')
		.text('Number of towns: ' + document.getElementById("slider").value);
	};
}

//function to reset the map that accepts a new number of towns 
// and removes elements that will be re-generated
function Reset_map(new_number_of_towns) {
	d3.select('svg:nth-child(2)').remove();
	d3.selectAll('circle').remove();
	d3.select('text').remove();
	Update_population_data(new_number_of_towns);
	Draw();	
}

//draw the map when the page first loads
window.onload=Draw;

